@Component({
  selector: 'search',
  templateUrl: './search.component.html',
  styleUrls: ['./ssearch.component.css']
})
export class SearchComponent {
  public searchedText:string | undefined;
}
<p>Welcome to Library System</p>
<p>What would You like to reqad today?</p>
<input type="text" [(ngModel)]="searchedText" placeholder="Enter your preffered read for today">
